if(!isset($data[0]['finicio'])){
    if($i>1){
        $fechaIngreso = strtoupper(obtenerMesEnLetra($data[0]['fechaIngreso']));
    } else {
        $fechaIngreso = date("d-m-Y", strtotime($row['fechaIngreso']));
    }
}else{
    $fechaIngreso = date("d-m-Y", strtotime($data[0]['finicio'])) ." al " . date("d-m-Y", strtotime($data[0]['ffin']));
